import React, { useState } from 'react';


const Input=({onChange})=>{
    const [inputVal,setVal]=useState("");

    function change(e){
       setVal(e.target.value);
    }

    return(
    <React.Fragment>
        <Input onChange={change} value={inputVal}/>
    </React.Fragment>
    )

}


export default Input;
